import './App.css';
import Home from './Home';
import Header from './Header';
import Login from './Login';
import Register from './Register';
import About from './About';

import { 
  BrowserRouter, 
  Routes, 
  Route
 } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Header />
        <Home />
        <About />
        <Register />
        <Login />
      </div>
    </BrowserRouter>

  );
}

export default App;
